import React, { useState, useEffect, useCallback, useRef } from "react";
import Papa from "papaparse";
import { Line } from "react-chartjs-2";
import "chart.js/auto";

// Video Mapping
const videoMapping = {
  0: { name: "Sit", path: "/videos/sit.mp4" },
  1: { name: "Forward Bend", path: "/videos/forward_bend.mp4" },
  2: { name: "Warrior Pose", path: "/videos/warrior.mp4" },
  3: { name: "Triangle Pose", path: "/videos/triangle.mp4" },
  4: { name: "Vajrasana", path: "/videos/vajrasan.mp4" },
  5: { name: "Backward Bend", path: "/videos/backwardbend_pose.mp4" },
};

// Constants for graph display
const WINDOW_SIZE = 50; // Number of points to show at once
const UPDATE_INTERVAL = 100; // Update every 100ms for smoother animation

const CsvGraphPlotter = () => {
  const [data, setData] = useState([]);
  const [currentIndex, setCurrentIndex] = useState(0);
  const [chartData, setChartData] = useState({
    labels: Array(WINDOW_SIZE).fill(''),
    datasets: Array(52).fill(null).map((_, idx) => ({
      label: `Column ${idx + 1}`,
      data: Array(WINDOW_SIZE).fill(0),
      borderColor: `rgba(${Math.random() * 255}, ${Math.random() * 255}, ${Math.random() * 255}, 0.6)`,
      borderWidth: 1,
      fill: false,
      tension: 0.4, // Add smooth curves to the lines
    }))
  });
  const [currentActivity, setCurrentActivity] = useState("Unknown Activity");
  const [videoSrc, setVideoSrc] = useState("");
  const chartRef = useRef(null);

  const updateChartAndVideo = useCallback((startIndex) => {
    if (startIndex >= data.length) {
      setCurrentIndex(0); // Reset to beginning when reaching the end
      return;
    }

    const row = data[startIndex];

    // Update chart data with sliding window effect
    setChartData(prevChartData => {
      const newDatasets = prevChartData.datasets.map((dataset, colIdx) => ({
        ...dataset,
        data: [
          ...dataset.data.slice(1), // Remove oldest point
          parseFloat(row[colIdx]) || 0 // Add new point
        ]
      }));

      return {
        labels: prevChartData.labels,
        datasets: newDatasets
      };
    });

    // Update video
    const label = parseInt(row[52], 10);
    if (videoMapping[label]) {
      setCurrentActivity(videoMapping[label].name);
      setVideoSrc(videoMapping[label].path);
    } else {
      setCurrentActivity("Unknown Activity");
      setVideoSrc("");
    }

    // Force chart update
    if (chartRef.current) {
      chartRef.current.chart.update('none'); // Use 'none' mode for smoother updates
    }
  }, [data]);

  const handleFileUpload = (event) => {
    const file = event.target.files[0];
    if (file) {
      Papa.parse(file, {
        complete: (result) => {
          const parsedData = result.data.filter((row) => row.length === 53);
          setData(parsedData);
          setCurrentIndex(0);
        },
        header: false,
        skipEmptyLines: true,
      });
    }
  };

  useEffect(() => {
    if (data.length === 0) return;

    const interval = setInterval(() => {
      updateChartAndVideo(currentIndex);
      setCurrentIndex(prevIndex => (prevIndex + 1) % data.length);
    }, UPDATE_INTERVAL);

    return () => clearInterval(interval);
  }, [data, currentIndex, updateChartAndVideo]);

  return (
    <div style={{ textAlign: "center", padding: "20px" }}>
      <h1>Real-time CSV Graph Plotter</h1>
      <input
        type="file"
        accept=".csv"
        onChange={handleFileUpload}
        style={{ margin: "20px", padding: "10px" }}
      />

      <div style={{ display: "flex", justifyContent: "space-around", padding: "20px" }}>
        <div style={{ width: "45%", height: "400px" }}>
          <Line
            ref={chartRef}
            data={chartData}
            options={{
              responsive: true,
              maintainAspectRatio: false,
              scales: {
                x: {
                  display: true,
                  grid: { display: false },
                  ticks: { display: false }
                },
                y: {
                  display: true,
                  grid: { color: 'rgba(0,0,0,0.1)' },
                  min: 0,
                  max: 20,
                  ticks: {
                    stepSize: 2,
                    callback: (value) => value.toFixed(1)
                  }
                }
              },
              animation: { duration: 0 },
              plugins: {
                legend: { display: false },
                tooltip: { enabled: false }
              }
            }}
          />
        </div>

        <div style={{ width: "45%" }}>
          <h1>Current Activity: {currentActivity}</h1>
          {videoSrc ? (
            <video
              key={videoSrc}
              width="100%"
              height="400"
              loop
              autoPlay
              muted
              controls={false}
              style={{
                objectFit: "contain",
                pointerEvents: "none",
              }}
            >
              <source src={videoSrc} type="video/mp4" />
              Your browser does not support the video tag.
            </video>
          ) : (
            <p>No video available for the current activity.</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default CsvGraphPlotter;
